	add("vibratiuncula", "{\"term\":\"vibratiuncula\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Diminutive of \u0027vibrātiō\u0027 (brandishing, vibration, agitation) from \u0027vibrō\u0027 (brandish, shake, agitate)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1750\u0027\u0027: Elizabeth Carter, [letter from] \u0027Mrs. Carter to Miss Talbot\u0027 (Deal, \u0027Dec.\u0027 1, 1750); printed in\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1809\u0027\u0027: the Rev. Montagu Pennington, M.A., \u0027A Series of Letters Between Mrs. Elizabeth Carter and Miss Catherine Talbot, from the Year 1741 to 1770\u0027, volume 1, pages \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dO9I0AAAAMAAJ\u0026amp;pg\u003dPA366\u0026amp;dq\u003dvibratiunculas\u0026amp;ei\u003dCLuASvflJoa6zATK-vXFC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dvibratiunculas\u0026amp;f\u003dfalse 366]–[http://books.google.co.uk/books?id\u003dO9I0AAAAMAAJ\u0026amp;pg\u003dPA367\u0026amp;dq\u003dvibratiunculas\u0026amp;ei\u003dCLuASvflJoa6zATK-vXFC\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dvibratiunculas\u0026amp;f\u003dfalse 367]\u0026lt;/span\u0026gt; (printed for F. C. and J. Rivington by Law and Gilbert Printers, St. John’s-Square, London\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I have upon the strength of your recommendation ventured again to look into Dr. Hartley; I was at first sufficiently puzzled with \u0027vibrations\u0027, but \u0027\u0027\u0027vibratiunculas\u0027\u0027\u0027 are beyond all mortal sufferance, and for any thing I am likely to learn by this part of the book, it would be as much to my profit to read the history of Parismus and Parismenus. After all\u0026lt;br/\u0026gt; \u0026lt;small\u0026gt;In vain we search the wondrous cause to find\u0026lt;/small\u0026gt;\u0026lt;br/\u0026gt; \u0026lt;small\u0026gt;How mind on body, body acts on mind.\u0026lt;/small\u0026gt;\u0026lt;br/\u0026gt;(with many more quotations and quotatiunculas which might be alleged to the same purpose) and all hypotheses about it seem equally perplexed and ineffectual. But however unsatisfactory these kind of systems may be, they are by no means to be treated with contempt. They are the result of great powers of understanding and strong habits of thinking; and an ingenious author who means well, is to be indulged in some few harmless whims, as it often happens (in a way which perhaps it may be impossible for all vibrations and \u0027\u0027vibratiunculas\u0027\u0027 in the world to account for) that obscure, and even in themselves useless speculations, lead to the discovery of evident and important truths\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1809\u0027\u0027: George Walker, \u0027Essays on Various Subjects: To Which is Prefixed a Life of the Author‎\u0027, volume 2, essay viii: \u0027Probable arguments in favour of the immateriality of the soul\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dvVIUAAAAYAAJ\u0026amp;pg\u003dPA51\u0026amp;dq\u003dvibratiuncula\u0026amp;ei\u003d28GASubRG5u-ygSxusDiC\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dvibratiuncula\u0026amp;f\u003dfalse page 51]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"There is another illustration, which at least confers more dignity on the subject, than any tale of vibrations and \u0027\u0027\u0027vibratiunculæ\u0027\u0027\u0027 can do\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1822\u0027\u0027: John Robison, David Brewster, and James Watt, \u0027A System of Mechanical Philosophy\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003di-wDAAAAMAAJ\u0026amp;pg\u003dPA476\u0026amp;dq\u003dvibratiunculae\u0026amp;ei\u003d7cKASqDkBpW-zASC6ozMC\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dvibratiunculae\u0026amp;f\u003dfalse page 476]\u0026lt;/span\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Nothing therefore is more unwarrantable, or more plainly shews the precipitant presumption of modern sciolists, than the familiar use of the general theory of aerial undulations in their attempts to explain the abstruse phenomena of nature (such as the communication of sensation from the organ to the sensorium by the vibrations of a nervous fluid, the reciprocal communication of the volitions from the sensorium to the muscle, nay, the whole phenomena of mind), by vibrations and \u0027\u0027vibratiunculæ\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027: Gian Napoleone Giordano Orsini, \u0027Coleridge and German Idealism: A Study in the History of Philosophy with Unpublished Materials from Coleridge’s Manuscripts\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?ei\u003d7cKASqDkBpW-zASC6ozMCg\u0026amp;id\u003dbG-wAAAAIAAJ\u0026amp;dq\u003dvibratiunculae\u0026amp;q\u003d%22or+vibratiunculae%2\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"search_anchor 19]\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; and [http://books.google.co.uk/books?ei\u003d7cKASqDkBpW-zASC6ozMCg\u0026amp;id\u003dbG-wAAAAIAAJ\u0026amp;dq\u003dvibratiunculae\u0026amp;q\u003d%22his+vibratiunculae%2\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"search_anchor 206]\u0026lt;/span\u0026gt;\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; (Southern Illinois University Press\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; This “peculiar system” centered in the doctrine of “miniature vibrations” or \u0027\u0027\u0027vibratiunculae\u0027\u0027:\u0027 “sensory vibrations” in the body cause a tendency to “diminutive vibrations” in the brain\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; From this vantage point in Schelling’s idealism, Coleridge could look down upon his early empiricist masters, such as Hartley with his \u0027\u0027\u0027vibratiunculae\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027: Tim Fulford, \u0027Romanticism and science, 1773–1833\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dsVU1UqLFYFUC\u0026amp;pg\u003dPA65\u0026amp;dq\u003dvibratiunculae\u0026amp;ei\u003d7cKASqDkBpW-zASC6ozMC\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dvibratiunculae\u0026amp;f\u003dfalse page 65] ([http://www.taylorandfrancis.com/ Taylor \u0026amp; Francis]\u0026lt;/span\u0026gt;; ISBN 0415219531, 9780415219532\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"For, if intelligence and design be nothing but a certain modification of the \u0027\u0027\u0027vibratiunculæ\u0027\u0027\u0027 or undulations of any kind, what is supreme intelligence, but a more extensive, and (perhaps they will call it) refined undulation, pervading or mixing with all others\", \"priority\":19}]}, \"synonyms\":{}}");

